import React from 'react';
import * as s from './styled';
import { ShareAltOutlined, DownloadOutlined } from '@ant-design/icons';
import { DeleteFilled } from '@ant-design/icons/lib';
import { Button, Modal, Select } from 'antd';
import { useSelector } from 'react-redux';
import { RootState } from '../../../../../redux';

const array = [
  {
    image:
      'data:image/png;base64,',
    user: 'Poprotska Daria',
  },
  {
    image:
      'data:image/png;base64,',
    user: 'Poprotska Daria',
  },
  {
    image:
      'data:image/png;base64,',
    user: 'Lucy Can',
  },
  {
    image:
      'data:image/png;base64,',
    user: 'Roman Morys',
  },
  {
    image:
      'data:image/png;base64,',
    user: 'Poprotska Daria',
  },
];

export const MyDrawingsComponent: React.FC = () => {
  const [open, setOpen] = React.useState(false);
  const onClose = React.useCallback(() => {
    setOpen(false);
  }, []);
  const onShare = React.useCallback(() => {
    setOpen(false);
  }, []);
  const subscriptions = useSelector<RootState, string[]>(
    state => state.mainPage.subscriptions,
  );
  return (
    <>
      <s.DrawingStyled>
        {array.map((item, index) => (
          <div
            key={index}
            style={{ border: '1px solid lightgrey', height: 224 }}
          >
            <s.IconsBlockStyled>
              <s.IconStyled>
                <DownloadOutlined />
              </s.IconStyled>
              <s.IconStyled>
                <DeleteFilled />
              </s.IconStyled>
              <s.IconStyled onClick={() => setOpen(true)}>
                <ShareAltOutlined />
              </s.IconStyled>
            </s.IconsBlockStyled>
            <img src={item.image} height={200} width={200} />
            <div>{`Creator: ${item.user}`}</div>
          </div>
        ))}
      </s.DrawingStyled>
      <Modal
        visible={open}
        title="Share image"
        footer={[
          <Button key="close" onClick={onClose}>
            Close
          </Button>,
          <Button key="share" type="primary" onClick={onShare}>
            Share
          </Button>,
        ]}
      >
        <p>Available Users: </p>
        <Select style={{ width: 300 }}>
          {subscriptions.map(item => (
            <Select.Option key={item}>{item}</Select.Option>
          ))}
        </Select>
      </Modal>
    </>
  );
};
